description:
Atsisiuntę „esveikata“ mobiliąją programėlę galėsite:

Peržiūrėti savo sveikatos istoriją;
Užsiregistruoti pas gydytoją, atšaukti savo registraciją;
Peržiūrėti savo registracijas kalendoriuje;
Gauti priminimus apie artėjančius vizitus;
Peržiūrėti ir tvarkyti duomenis apie atstovaujamus asmenis;
Peržiūrėti ir atsisiųsti medicininius dokumentus: pažymas, siuntimus, el. receptus ir kt.;
Peržiūrėti skiepų kalendorių.

Pregnant? Just track your pregnancy week by week using Pregnancy App.

With Pregnancy App you can easily: 
- track your pregnancy;
- get information about your pregnancy;
- get current pregnancy week and use pregnancy calendar;
- calculate due date (pregnancy date);
- manage contractions with contraction counter
- track kicks with kick counter
- track your pregnancy weight

Pregnancy Tracker is very helpful for a pregnant woman.
Free pregnancy app. 
Powered by Amila.
